import React from 'react'
import Header from '../../component/Header'
import SubNavbar from '../../component/SubNavbar'
import Feature2 from '../../component/Feature2'
import StackedBarChart from '../../component/StackedBarChart'

const Agents = () => {
    const filters = [
        {
            label: "Filter by Ring Group",
            name: "filterByRingGroup",
            value: [
                "All ring groups",
                "agents 2",
                "agents 3",
            ]
        },
    ]

    const dataCalls = [
        {
            value: "86:18:34",
            label: "Total Wait Time",
        },
        {
            value: "01:27",
            label: "Average Wait Time",
        },
        {
            value: "15:08",
            label: "Longest Wait Time",
        },
        {
            value: "01:46",
            label: "Average Abandonment Time",
        },
    ]

    const dataStackedBarChart = [
        {
            name: 'Step 14',
            agent1: 45,
            agent2: 40,
            agent3: 25,
            agent4: 2,
            barValue: [
                {
                    dataKey: "agent1",
                    fill: "#CC0000"
                },
                {
                    dataKey: "agent2",
                    fill: "#2D88CE"
                },
                {
                    dataKey: "agent3",
                    fill: "#2D88CE"
                },
                {
                    dataKey: "agent4",
                    fill: "#2D88CE"
                },
            ],
        },
        {
            name: 'Step 15',
            waitTime: 50,
        },
        {
            name: 'Step 16',
            waitTime: 52,
        },
        {
            name: 'Step 17',
            waitTime: 100,
        },
        {
            name: 'Step 18',
            waitTime: 100,
        },
        {
            name: 'Step 19',
            waitTime: 70,
        },
        {
            name: 'Step 20',
            waitTime: 45,
        },
    ]

    const dataPieChartWithNeedle = [
        { name: 'A', value: 111.6, color: '#00CC00' },
        { name: 'B', value: 68.4, color: '#CC0000' },
    ]
    return (
        <div id="agents">
            <Header />
            <div className='main-content'>
                <SubNavbar />
                <Feature2
                    text="Agent Metrics"
                />

                <div style={{ display: "flex", padding: "0 60px 40px 40px" }}>
                    {/* display filter */}
                    {filters.map((filter, index) => {
                        return (
                            <div style={{ paddingRight: "80px" }}>
                                <label for={filter.name}>{filter.label}</label>
                                <br></br>
                                <select name={filter.name} id={filter.name}
                                    style={{ width: "240px", height: "30px", fontSize: "14px" }}
                                >
                                    {filter.value.map((optionValue, optionIndex) => {
                                        return (
                                            <option value={optionValue}>{optionValue}</option>
                                        )
                                    })}
                                </select>
                            </div>
                        )
                    })}

                </div>

                {/* display Chart */}
                <div style={{ display: "flex", alignContent: "center", justifyContent: "center" }}>
                    {/* display Pie Chart With Needle */}
                    <div style={{ display: "flex", flexDirection: "column", alignContent: "center", justifyContent: "center" }}>

                    </div>

                    {/* display Stacked Bar Chart */}
                    <StackedBarChart
                        data={dataStackedBarChart}
                        title="Number of Agents"
                        styleChart={{
                            display: "flex",
                            justifyContent: "center",
                            backgroundColor: "#E0E0E0",
                            padding: "100px 0px 40px 0px",
                            margin: "0 0px 10px 20px",
                            width: "1000px",
                            height: "600px",
                        }}
                        styleTitle={{
                            fontSize: "18px",
                            position: "relative",
                            left: "280px",
                            top: "-40px",
                            margin: "0 0 0 -200px",
                        }}
                    />
                </div>


            </div>

        </div>
    )
}

export default Agents
